import React from "react";
import styled from "styled-components";
import SVG from "../static/svg/svg";
import { SvgContainer } from "./Useless";
const Container = styled.div`
    width: 100%;
    height: 50px;
    display: flex;

    align-items: center;
    justify-content: center;
    svg {
        width: 35px;
        height: 35px;
        fill: white;
    }
`;
const ActionMenu = () => {
    return (
        <Container>
            <SVG type="heart" /> <p>Like it</p>
        </Container>
    );
};

export default ActionMenu;
